<div data-component-name="KernelViewer" style="display: flex; flex-direction: column; flex: 1 0 auto;"></div><script>var Kaggle=window.Kaggle||{};Kaggle.State=Kaggle.State||[];Kaggle.State.push({"kernel":{"id":397279,"title":"Titanic_Challange_","forkParent":null,"currentRunId":1685037,"mostRecentRunId":1685037,"url":"/tosnaldo10/titanic-challange","tags":[],"commentCount":0,"upvoteCount":0,"viewCount":555,"forkCount":2,"bestPublicScore":0.80382,"author":{"id":1320524,"displayName":"Elton Snell","email":null,"editedEmail":null,"editedEmailCode":null,"userName":"tosnaldo10","thumbnailUrl":"https://storage.googleapis.com/kaggle-avatars/thumbnails/default-thumb.png","profileUrl":"/tosnaldo10","registerDate":"0001-01-01T00:00:00Z","lastVisitDate":"0001-01-01T00:00:00Z","statusId":0,"performanceTier":0,"userRoles":null,"userLogins":null,"groupIds":null,"duplicateUsers":null,"hasPhoneVerifications":false,"failedNerdchas":0,"hasPendingNerdcha":false,"deleteRequests":null,"userAttributes":null,"isAdmin":false,"isTvc":false,"isKaggleBot":false,"isAdminOrTvc":false,"isAnonymous":false,"canAct":false,"canBeSeen":false,"thumbnailName":null,"activationCode":"00000000-0000-0000-0000-000000000000","isPhoneVerified":false},"isPrivate":false,"updatedTime":"2017-10-31T08:01:14.2766667Z","selfLink":"/kernels/397279","pinnedDockerImageVersionId":null,"isLanguageTemplate":false,"medal":null,"topicId":null,"readGroupId":null,"writeGroupId":null,"slug":"titanic-challange"},"kernelBlob":{"id":7706677,"settings":{"dockerImageVersionId":null,"dataSources":[{"sourceType":"Competition","sourceId":3136,"databundleVersionId":null}],"sourceType":"script","language":"r","isGpuEnabled":false,"isInternetEnabled":false},"source":"#Titanic Challenge_\r\n#The below script is my first attempt at R and predictive modelling.\r\n#I work with in a data environment and have always had questions of why business does not use more then just the variables.\r\n#What i know now after my attempted model through the help of the Kaggle community is that there is value to be found and that we can learn from past events.\r\n#\r\n#\r\n#My approach was to focus on all variables that would help with identifying the positioning of people the time they realized the ship was sinking.\r\n#we have heard the term when something bad happens that he/she was in the wrong place at the wrong time and there is a lot of thuth in this hence my angle of approach.\r\n#\r\n#I tried keeping the code simple so that hopefully one person with no experience in R or predictive modeling can find some once of value in it.\r\n#\r\n#\r\n#\r\n#load packages\r\nlibrary(\u0027ggplot2\u0027)  \r\nlibrary(\u0027caret\u0027) \r\nlibrary(\u0027dplyr\u0027)\r\nlibrary(\u0027rpart\u0027)\r\nlibrary(\u0027rpart.plot\u0027)\r\nlibrary(\u0027car\u0027)\r\nlibrary(\u0027e1071\u0027)\r\nlibrary(\u0027randomForest\u0027)\r\nlibrary(\u0027ggthemes\u0027) \r\n#Importing Data\r\ntrain.tit \u003c- read.csv(\u0027../input/train.csv\u0027, stringsAsFactors = F)\r\ntest.tit  \u003c- read.csv(\u0027../input/test.csv\u0027, stringsAsFactors = F)\r\ntest.tit$Survived \u003c- rep(0, 418)\r\nstr(test.tit)\r\n\r\n#combining the two files but analysis will be done on the first 891 observations\r\n#combo  \u003c- bind_rows(train, test) # bind training \u0026 test data\r\ncombo \u003c- rbind(train.tit, test.tit)\r\n\r\nstr(combo)\r\n\r\n#Checking for missing values in each variables and  doing imputation on Embarked\r\ncolSums(is.na(combo))\r\ncolSums(combo==\u0027\u0027)\r\ncombo$Embarked[combo$Embarked==\u0022\u0022]=\u0022S\u0022\r\ntable(combo$Embarked)\r\n\r\n#variables(Survived,Age,Cabin and Embarked) has missing and no values\r\n\r\n\r\n#Analyzing variables we planning to use and what impact they have on survival as well as some Feature engineering on Name and variable\r\n#Analysis will be done on the first 891 observations(from train set)\r\n\r\n\r\n#Lets explore variable Name first as we plan to use the variable to create a variable Title that should be helpfull as Titles mattered more in that era\r\n\r\nhead(combo$Name)\r\nnames \u003c- combo$Name\r\ntitle \u003c-  gsub(\u0022^.*, (.*?)\\\\..*$\u0022, \u0022\\\\1\u0022, names)\r\n\r\ncombo$title \u003c- title\r\n\r\ntable(title)\r\n combo$Name \u003c- as.character(combo$Name)\r\n combo$Name[1]\r\n#group rare title as factor\r\nrare_title \u003c- c(\u0027Dona\u0027, \u0027the Countess\u0027,\u0027Capt\u0027, \u0027Col\u0027, \u0027Don\u0027, \r\n                \u0027Dr\u0027, \u0027Major\u0027, \u0027Rev\u0027, \u0027Sir\u0027, \u0027Jonkheer\u0027)\r\n#grouping titles                \r\ncombo$title[combo$title == \u0027Mlle\u0027]        \u003c- \u0027Miss\u0027 \r\ncombo$title[combo$title == \u0027Ms\u0027]          \u003c- \u0027Miss\u0027\r\ncombo$title[combo$title == \u0027Mme\u0027]         \u003c- \u0027Mrs\u0027 \r\ncombo$title[combo$title == \u0027Lady\u0027]          \u003c- \u0027Miss\u0027\r\ncombo$title[combo$title == \u0027Dona\u0027]          \u003c- \u0027Miss\u0027\r\ncombo$title[combo$title %in% rare_title]  \u003c- \u0027Rare Title\u0027\r\n\r\n ggplot(combo[1:891,],aes(x = title,fill=factor(Survived))) +\r\n  geom_bar() +\r\n  ggtitle(\u0022Title V/S Survival rate\u0022)+\r\n  xlab(\u0022Title\u0022) +\r\n  ylab(\u0022Total Count\u0022) +\r\n  labs(fill = \u0022Survived\u0022) \r\n\r\nstr(combo)\r\n\r\n\r\n#Relationships matters single people would have been more scattered around the ship the smaller families, bigger families could also be scattered in part\r\n#creating familysize factor\r\ncombo$FamilySize \u003c-combo$SibSp + combo$Parch + 1\r\n\r\ncombo$FamilySized[combo$FamilySize == 1]   \u003c- \u0027Single\u0027\r\ncombo$FamilySized[combo$FamilySize \u003c 5 \u0026 combo$FamilySize \u003e= 2]   \u003c- \u0027Small\u0027\r\ncombo$FamilySized[combo$FamilySize \u003e= 5]   \u003c- \u0027Big\u0027\r\n\r\ncombo$FamilySized=as.factor(combo$FamilySized)\r\n\r\nggplot(combo[1:891,],aes(x = FamilySized,fill=factor(Survived))) +\r\n  geom_bar() +\r\n  ggtitle(\u0022Family Size V/S Survival Rate\u0022) +\r\n  xlab(\u0022FamilySize\u0022) +\r\n  ylab(\u0022Total Count\u0022) +\r\n  labs(fill = \u0022Survived\u0022)\r\n\r\nstr(combo)\r\n\r\n\r\n#PCLASS class is our GPS and gives us some idea where and how far people were from the life boats and safer areas on the ship while it was still a float\r\nggplot(combo[1:891,],aes(x = Pclass,fill=factor(Survived))) +\r\ngeom_bar() +\r\nggtitle(\u0022Pclass v/s Survival Rate\u0022)+\r\nxlab(\u0022Pclass\u0022) +\r\nylab(\u0022Total Count\u0022) +\r\nlabs(fill = \u0022Survived\u0022)  \r\n\r\n\r\n#Sex it was the ladies and kids first era where being a gentlemen ment something\r\nggplot(combo[1:891,],aes(x = Sex,fill=factor(Survived))) +\r\ngeom_bar() +\r\nggtitle(\u0022Sex v/s Survival Rate\u0022)+\r\nxlab(\u0022Sex\u0022) +\r\nylab(\u0022Total Count\u0022) +\r\nlabs(fill = \u0022Survived\u0022)  \r\n\r\n#have a look at the status of the combined set Combo\r\nstr(combo)\r\ncolSums(is.na(combo))\r\ncolSums(combo==\u0027\u0027)\r\n\r\n\r\n#Prediction\r\n\r\n#Create factors for variables we going to use\r\ncombo$Embarked=as.factor(combo$Embarked)\r\ncombo$Pclass=as.factor(combo$Pclass)\r\ncombo$title=as.factor(combo$title)\r\ncombo$Sex=as.factor(combo$Sex)\r\ncombo$Embarked=as.factor(combo$Embarked)\r\n\r\n# Split the data back into a train set and a test set\r\ntrain \u003c- combo[1:891,c(\u0022Pclass\u0022, \u0022title\u0022,\u0022Sex\u0022,\u0022Embarked\u0022,\u0022FamilySized\u0022,\u0022Survived\u0022)]\r\ntest \u003c- combo[892:1309,c(\u0022Pclass\u0022, \u0022title\u0022,\u0022Sex\u0022,\u0022Embarked\u0022,\u0022FamilySized\u0022,\u0022Survived\u0022)] \r\n\r\n\r\n##Random Forest\r\n#i went for this algorithm as  I wanted to see how other variables impacted the Survived variable and the chance of survival on the ship.\r\n#As per the one on one comparison between identified variables versus the Survived variable.\r\n#\r\n#\r\n# Set a random seed\r\nset.seed(754)\r\n\r\n# Build the model (note: not all possible variables are used)\r\nrf_model \u003c- randomForest(factor(Survived) ~ Pclass + title + Sex,  data = train)\r\n\r\n# Show model error\r\nplot(rf_model, ylim=c(0,0.50))\r\nlegend(\u0027topright\u0027, colnames(rf_model$err.rate), col=1:3, fill=1:3)\r\n\r\n# Predict using the test set\r\nprediction \u003c- predict(rf_model, test)\r\n\r\n# Save the solution to a dataframe with two columns: PassengerId and Survived (prediction)\r\nsolution \u003c- data.frame(PassengerID = test.tit$PassengerId, Survived = prediction)\r\n\r\n# Write the solution to file\r\nwrite.csv(solution, file = \u0027rf_mod_Solution.csv\u0027, row.names = F)\r\n#\r\n#\r\n#\r\n## Get importance\r\n#looking at te rank of variables on the outcome of survival\r\n#\r\n#\r\nimportance    \u003c- importance(rf_model)\r\nvarImportance \u003c- data.frame(Variables = row.names(importance), \r\n                            Importance = round(importance[ ,\u0027MeanDecreaseGini\u0027],2))\r\n\r\n# Create a rank variable based on importance\r\nrankImportance \u003c- varImportance %\u003e%\r\n  mutate(Rank = paste0(\u0027#\u0027,dense_rank(desc(Importance))))\r\n\r\n# Use ggplot2 to visualize the relative importance of variables\r\nggplot(rankImportance, aes(x = reorder(Variables, Importance), \r\n    y = Importance, fill = Importance)) +\r\n  geom_bar(stat=\u0027identity\u0027) + \r\n  geom_text(aes(x = Variables, y = 0.5, label = Rank),\r\n    hjust=0, vjust=0.55, size = 4, colour = \u0027red\u0027) +\r\n  labs(x = \u0027Variables\u0027) +\r\n  coord_flip() + \r\n  theme_few()\r\n\r\n\r\n#Propensity as per mosaicplot below\r\n#More men then woman bought tickets\r\n#Most people embarked from area S \r\n#Wealthier people embarked from area C\r\n#Most males as they say are third class citizen which seems to be one of the reason mostly males died.\r\n#\r\nmosaicplot(table(train$Pclass, train$Sex,train$Embarked), main=\u0027Population by Sex\u0027, shade=TRUE)\r\n\r\n\r\n","dateCreated":"2017-10-31T08:01:01.297Z"},"kernelRun":{"id":1685037,"kernelId":397279,"status":"complete","type":"batch","sourceType":"script","language":"r","title":"Titanic_Challange_","dateCreated":"2017-10-31T08:01:01.297Z","dateEvaluated":"2017-10-31T08:01:14.277Z","workerContainerPort":null,"workerUptimeSeconds":837528,"workerIPAddress":"172.16.1.4     ","scriptLanguageId":1,"scriptLanguageName":"R","renderedOutputUrl":null,"commit":{"id":7706677,"settings":{"dockerImageVersionId":null,"dataSources":[{"sourceType":"Competition","sourceId":3136,"databundleVersionId":null}],"sourceType":"script","language":"r","isGpuEnabled":false,"isInternetEnabled":false},"source":"#Titanic Challenge_\r\n#The below script is my first attempt at R and predictive modelling.\r\n#I work with in a data environment and have always had questions of why business does not use more then just the variables.\r\n#What i know now after my attempted model through the help of the Kaggle community is that there is value to be found and that we can learn from past events.\r\n#\r\n#\r\n#My approach was to focus on all variables that would help with identifying the positioning of people the time they realized the ship was sinking.\r\n#we have heard the term when something bad happens that he/she was in the wrong place at the wrong time and there is a lot of thuth in this hence my angle of approach.\r\n#\r\n#I tried keeping the code simple so that hopefully one person with no experience in R or predictive modeling can find some once of value in it.\r\n#\r\n#\r\n#\r\n#load packages\r\nlibrary(\u0027ggplot2\u0027)  \r\nlibrary(\u0027caret\u0027) \r\nlibrary(\u0027dplyr\u0027)\r\nlibrary(\u0027rpart\u0027)\r\nlibrary(\u0027rpart.plot\u0027)\r\nlibrary(\u0027car\u0027)\r\nlibrary(\u0027e1071\u0027)\r\nlibrary(\u0027randomForest\u0027)\r\nlibrary(\u0027ggthemes\u0027) \r\n#Importing Data\r\ntrain.tit \u003c- read.csv(\u0027../input/train.csv\u0027, stringsAsFactors = F)\r\ntest.tit  \u003c- read.csv(\u0027../input/test.csv\u0027, stringsAsFactors = F)\r\ntest.tit$Survived \u003c- rep(0, 418)\r\nstr(test.tit)\r\n\r\n#combining the two files but analysis will be done on the first 891 observations\r\n#combo  \u003c- bind_rows(train, test) # bind training \u0026 test data\r\ncombo \u003c- rbind(train.tit, test.tit)\r\n\r\nstr(combo)\r\n\r\n#Checking for missing values in each variables and  doing imputation on Embarked\r\ncolSums(is.na(combo))\r\ncolSums(combo==\u0027\u0027)\r\ncombo$Embarked[combo$Embarked==\u0022\u0022]=\u0022S\u0022\r\ntable(combo$Embarked)\r\n\r\n#variables(Survived,Age,Cabin and Embarked) has missing and no values\r\n\r\n\r\n#Analyzing variables we planning to use and what impact they have on survival as well as some Feature engineering on Name and variable\r\n#Analysis will be done on the first 891 observations(from train set)\r\n\r\n\r\n#Lets explore variable Name first as we plan to use the variable to create a variable Title that should be helpfull as Titles mattered more in that era\r\n\r\nhead(combo$Name)\r\nnames \u003c- combo$Name\r\ntitle \u003c-  gsub(\u0022^.*, (.*?)\\\\..*$\u0022, \u0022\\\\1\u0022, names)\r\n\r\ncombo$title \u003c- title\r\n\r\ntable(title)\r\n combo$Name \u003c- as.character(combo$Name)\r\n combo$Name[1]\r\n#group rare title as factor\r\nrare_title \u003c- c(\u0027Dona\u0027, \u0027the Countess\u0027,\u0027Capt\u0027, \u0027Col\u0027, \u0027Don\u0027, \r\n                \u0027Dr\u0027, \u0027Major\u0027, \u0027Rev\u0027, \u0027Sir\u0027, \u0027Jonkheer\u0027)\r\n#grouping titles                \r\ncombo$title[combo$title == \u0027Mlle\u0027]        \u003c- \u0027Miss\u0027 \r\ncombo$title[combo$title == \u0027Ms\u0027]          \u003c- \u0027Miss\u0027\r\ncombo$title[combo$title == \u0027Mme\u0027]         \u003c- \u0027Mrs\u0027 \r\ncombo$title[combo$title == \u0027Lady\u0027]          \u003c- \u0027Miss\u0027\r\ncombo$title[combo$title == \u0027Dona\u0027]          \u003c- \u0027Miss\u0027\r\ncombo$title[combo$title %in% rare_title]  \u003c- \u0027Rare Title\u0027\r\n\r\n ggplot(combo[1:891,],aes(x = title,fill=factor(Survived))) +\r\n  geom_bar() +\r\n  ggtitle(\u0022Title V/S Survival rate\u0022)+\r\n  xlab(\u0022Title\u0022) +\r\n  ylab(\u0022Total Count\u0022) +\r\n  labs(fill = \u0022Survived\u0022) \r\n\r\nstr(combo)\r\n\r\n\r\n#Relationships matters single people would have been more scattered around the ship the smaller families, bigger families could also be scattered in part\r\n#creating familysize factor\r\ncombo$FamilySize \u003c-combo$SibSp + combo$Parch + 1\r\n\r\ncombo$FamilySized[combo$FamilySize == 1]   \u003c- \u0027Single\u0027\r\ncombo$FamilySized[combo$FamilySize \u003c 5 \u0026 combo$FamilySize \u003e= 2]   \u003c- \u0027Small\u0027\r\ncombo$FamilySized[combo$FamilySize \u003e= 5]   \u003c- \u0027Big\u0027\r\n\r\ncombo$FamilySized=as.factor(combo$FamilySized)\r\n\r\nggplot(combo[1:891,],aes(x = FamilySized,fill=factor(Survived))) +\r\n  geom_bar() +\r\n  ggtitle(\u0022Family Size V/S Survival Rate\u0022) +\r\n  xlab(\u0022FamilySize\u0022) +\r\n  ylab(\u0022Total Count\u0022) +\r\n  labs(fill = \u0022Survived\u0022)\r\n\r\nstr(combo)\r\n\r\n\r\n#PCLASS class is our GPS and gives us some idea where and how far people were from the life boats and safer areas on the ship while it was still a float\r\nggplot(combo[1:891,],aes(x = Pclass,fill=factor(Survived))) +\r\ngeom_bar() +\r\nggtitle(\u0022Pclass v/s Survival Rate\u0022)+\r\nxlab(\u0022Pclass\u0022) +\r\nylab(\u0022Total Count\u0022) +\r\nlabs(fill = \u0022Survived\u0022)  \r\n\r\n\r\n#Sex it was the ladies and kids first era where being a gentlemen ment something\r\nggplot(combo[1:891,],aes(x = Sex,fill=factor(Survived))) +\r\ngeom_bar() +\r\nggtitle(\u0022Sex v/s Survival Rate\u0022)+\r\nxlab(\u0022Sex\u0022) +\r\nylab(\u0022Total Count\u0022) +\r\nlabs(fill = \u0022Survived\u0022)  \r\n\r\n#have a look at the status of the combined set Combo\r\nstr(combo)\r\ncolSums(is.na(combo))\r\ncolSums(combo==\u0027\u0027)\r\n\r\n\r\n#Prediction\r\n\r\n#Create factors for variables we going to use\r\ncombo$Embarked=as.factor(combo$Embarked)\r\ncombo$Pclass=as.factor(combo$Pclass)\r\ncombo$title=as.factor(combo$title)\r\ncombo$Sex=as.factor(combo$Sex)\r\ncombo$Embarked=as.factor(combo$Embarked)\r\n\r\n# Split the data back into a train set and a test set\r\ntrain \u003c- combo[1:891,c(\u0022Pclass\u0022, \u0022title\u0022,\u0022Sex\u0022,\u0022Embarked\u0022,\u0022FamilySized\u0022,\u0022Survived\u0022)]\r\ntest \u003c- combo[892:1309,c(\u0022Pclass\u0022, \u0022title\u0022,\u0022Sex\u0022,\u0022Embarked\u0022,\u0022FamilySized\u0022,\u0022Survived\u0022)] \r\n\r\n\r\n##Random Forest\r\n#i went for this algorithm as  I wanted to see how other variables impacted the Survived variable and the chance of survival on the ship.\r\n#As per the one on one comparison between identified variables versus the Survived variable.\r\n#\r\n#\r\n# Set a random seed\r\nset.seed(754)\r\n\r\n# Build the model (note: not all possible variables are used)\r\nrf_model \u003c- randomForest(factor(Survived) ~ Pclass + title + Sex,  data = train)\r\n\r\n# Show model error\r\nplot(rf_model, ylim=c(0,0.50))\r\nlegend(\u0027topright\u0027, colnames(rf_model$err.rate), col=1:3, fill=1:3)\r\n\r\n# Predict using the test set\r\nprediction \u003c- predict(rf_model, test)\r\n\r\n# Save the solution to a dataframe with two columns: PassengerId and Survived (prediction)\r\nsolution \u003c- data.frame(PassengerID = test.tit$PassengerId, Survived = prediction)\r\n\r\n# Write the solution to file\r\nwrite.csv(solution, file = \u0027rf_mod_Solution.csv\u0027, row.names = F)\r\n#\r\n#\r\n#\r\n## Get importance\r\n#looking at te rank of variables on the outcome of survival\r\n#\r\n#\r\nimportance    \u003c- importance(rf_model)\r\nvarImportance \u003c- data.frame(Variables = row.names(importance), \r\n                            Importance = round(importance[ ,\u0027MeanDecreaseGini\u0027],2))\r\n\r\n# Create a rank variable based on importance\r\nrankImportance \u003c- varImportance %\u003e%\r\n  mutate(Rank = paste0(\u0027#\u0027,dense_rank(desc(Importance))))\r\n\r\n# Use ggplot2 to visualize the relative importance of variables\r\nggplot(rankImportance, aes(x = reorder(Variables, Importance), \r\n    y = Importance, fill = Importance)) +\r\n  geom_bar(stat=\u0027identity\u0027) + \r\n  geom_text(aes(x = Variables, y = 0.5, label = Rank),\r\n    hjust=0, vjust=0.55, size = 4, colour = \u0027red\u0027) +\r\n  labs(x = \u0027Variables\u0027) +\r\n  coord_flip() + \r\n  theme_few()\r\n\r\n\r\n#Propensity as per mosaicplot below\r\n#More men then woman bought tickets\r\n#Most people embarked from area S \r\n#Wealthier people embarked from area C\r\n#Most males as they say are third class citizen which seems to be one of the reason mostly males died.\r\n#\r\nmosaicplot(table(train$Pclass, train$Sex,train$Embarked), main=\u0027Population by Sex\u0027, shade=TRUE)\r\n\r\n\r\n","dateCreated":"2017-10-31T08:01:01.297Z"},"resources":null,"isolatorResults":"\u003cresults\u003e\u003cdisk_kb_free\u003e945424\u003c/disk_kb_free\u003e\u003cdocker_image_id\u003esha256:a1012a8a5b19a781b2c435bc5c0838b38273a0bed004447065e801626df667d3\u003c/docker_image_id\u003e\u003cdocker_image_name\u003ekaggle/rstats\u003c/docker_image_name\u003e\u003cexit_code\u003e0\u003c/exit_code\u003e\u003cfailure_message /\u003e\u003cout_of_memory\u003eFalse\u003c/out_of_memory\u003e\u003crun_time_seconds\u003e9.28893957193941\u003c/run_time_seconds\u003e\u003csucceeded\u003eTrue\u003c/succeeded\u003e\u003ctimeout_exceeded\u003eFalse\u003c/timeout_exceeded\u003e\u003cused_all_space\u003eFalse\u003c/used_all_space\u003e\u003cwas_killed\u003eFalse\u003c/was_killed\u003e\u003c/results\u003e","runInfo":{"dockerfileUrl":"https://github.com/Kaggle/docker-rstats/blob/master/Dockerfile","dockerHubUrl":"https://registry.hub.docker.com/u/kaggle/rstats/","dockerImageDigest":null,"dockerImageId":"sha2 se,"isLabel":false,"info":null,"name":"Ticket","description":null},{"order":9,"originalType":"","type":"numeric","extendedType":null,"isNullable":false,"isPrimaryKey":false,"isLabel":false,"info":null,"name":"Fare","description":null},{"order":10,"originalType":"","type":"string","extendedType":null,"isNullable":false,"isPrimaryKey":false,"isLabel":false,"info":null,"name":"Cabin","description":null},{"order":11,"originalType":"","type":"string","extendedType":null,"isNullable":false,"isPrimaryKey":false,"isLabel":false,"info":null,"name":"Embarked","description":"The port in which a passenger has embarked. C - Cherbourg, S - Southampton, Q = Queenstown"}],"totalRows":null,"type":"genericTable","collapsed":true,"info":{"metrics":null,"archiveInfo":null,"archiveInfoV2":null,"blobFileInfo":null,"convertCsvInfo":null,"kernelReference":null},"settings":{"csvSettings":null,"bigQuerySettings":null,"bigQueryMirrorSettings":null,"storageSettings":null,"remoteUrlSettings":null,"remoteGithubSettings":null},"render":null,"children":[],"name":"","description":null}],"name":"train.csv","description":"contains data \n"}],"name":"Titanic: Machine Learning from Disaster","description":"\u003ch3\u003eOverview\u003c/h3\u003e\n\u003cp\u003eThe data has been split into two groups:\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003etraining set (train.csv)\u003c/li\u003e\n\u003cli\u003etest set (test.csv)\u003c/li\u003e\n\u003c/ul\u003e\n\u003cp\u003e\u003cb\u003e The training set \u003c/b\u003eshould be used to build your machine learning models. For the training set, we provide the outcome (also known as the ground truth) for each passenger. Your model will be based on features like passengers gender and class. You can also use \u003ca href=\u0022https://triangleinequality.wordpress.com/2013/09/08/basic-feature-engineering-with-the-titanic-data/\u0022 target=\u0022_blank\u0022\u003e feature engineering \u003c/a\u003eto create new features.\u003c/p\u003e\n\u003cp\u003e\u003cb\u003eThe test set \u003c/b\u003eshould be used to see how well your model performs on unseen data. For the test set, we do not provide the ground truth for each passenger. It is your job to predict these outcomes. For each passenger in the test set, use the model you trained to predict whether or not they survived the sinking of the Titanic.\u003c/p\u003e\n\u003cp\u003eWe also include \u003cb\u003egender_submission.csv\u003c/b\u003e, a set of predictions that assume all and only female passengers survive, as an example of what a submission file should look like.\u003c/p\u003e\n\u003ch3\u003eData Dictionary\u003c/h3\u003e\n\u003ctable style=\u0022width: 100%;\u0022\u003e\n\u003ctbody\u003e\n\u003ctr\u003e\u003cth\u003e\u003cb\u003eVariable\u003c/b\u003e\u003c/th\u003e\u003cth\u003e\u003cb\u003eDefinition\u003c/b\u003e\u003c/th\u003e\u003cth\u003e\u003cb\u003eKey\u003c/b\u003e\u003c/th\u003e\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003esurvival\u003c/td\u003e\n\u003ctd\u003eSurvival\u003c/td\u003e\n\u003ctd\u003e0 = No, 1 = Yes\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003epclass\u003c/td\u003e\n\u003ctd\u003eTicket class\u003c/td\u003e\n\u003ctd\u003e1 = 1st, 2 = 2nd, 3 = 3rd\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003esex\u003c/td\u003e\n\u003ctd\u003eSex\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eAge\u003c/td\u003e\n\u003ctd\u003eAge in years\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003esibsp\u003c/td\u003e\n\u003ctd\u003e# of siblings / spouses aboard the Titanic\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eparch\u003c/td\u003e\n\u003ctd\u003e# of parents / children aboard the Titanic\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eticket\u003c/td\u003e\n\u003ctd\u003eTicket number\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003efare\u003c/td\u003e\n\u003ctd\u003ePassenger fare\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003ecabin\u003c/td\u003e\n\u003ctd\u003eCabin number\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eembarked\u003c/td\u003e\n\u003ctd\u003ePort of Embarkation\u003c/td\u003e\n\u003ctd\u003eC = Cherbourg, Q = Queenstown, S = Southampton\u003c/td\u003e\n\u003c/tr\u003e\n\u003c/tbody\u003e\n\u003c/table\u003e\n\u003ch3\u003eVariable Notes\u003c/h3\u003e\n\u003cp\u003e\u003cb\u003epclass\u003c/b\u003e: A proxy for socio-economic status (SES)\u003cbr /\u003e 1st = Upper\u003cbr /\u003e 2nd = Middle\u003cbr /\u003e 3rd = Lower\u003cbr /\u003e\u003cbr /\u003e \u003cb\u003eage\u003c/b\u003e: Age is fractional if less than 1. If the age is estimated, is it in the form of xx.5\u003cbr /\u003e\u003cbr /\u003e \u003cb\u003esibsp\u003c/b\u003e: The dataset defines family relations in this way...\u003cbr /\u003e Sibling = brother, sister, stepbrother, stepsister\u003cbr /\u003e Spouse = husband, wife (mistresses and fiancs were ignored)\u003cbr /\u003e\u003cbr /\u003e \u003cb\u003eparch\u003c/b\u003e: The dataset defines family relations in this way...\u003cbr /\u003e Parent = mother, father\u003cbr /\u003e Child = daughter, son, stepdaughter, stepson\u003cbr /\u003e Some children travelled only with a nanny, therefore parch=0 for them.\u003c/p\u003e"}],"versions":[{"id":1685037,"kernelVersionId":null,"isForkParent":false,"isNotebook":false,"languageName":"R","lastRunTime":"2017-10-31T08:01:01.297Z","linesChangedFromPrevious":0,"linesDeletedFromPrevious":1,"linesInsertedFromPrevious":1,"outputFilesTotalSizeBytes":0,"runInfo":{"dockerfileUrl":"https://github.com/Kaggle/docker-rstats/blob/master/Dockerfile","dockerHubUrl":"https://registry.hub.docker.com/u/kaggle/rstats/","dockerImageId":"sha256:a1012a8a5b19a781b2c435bc5c0838b38273a0bed004447065e801626df667d3","dockerImageNa
